import React, { useState } from 'react';


const ContactDiv = (props) => {
  const [data, setData] = useState({
    fullName: '',
    phone: '',
    email: '',
    msg: ''
  });

  const { type, label, id, placeholder } = props;
  return (
    <div class="mb-3">
      <label for={id} class="form-label">{label}</label>
      <input
        type={type}
        class="form-control"
        id={id}
        name={id}
        value={data.id}
        onChange={fetchData}
        placeholder={placeholder} />
    </div>
  )
}


const Contact = () => {
  return (

    <div className="my-5">
      <h1 className='text-center'>Contact Us</h1>
      <div className="container">
        <div className="row">
          <div className="col-10 col-md-6 mx-auto">

            <form className='border p-4 mt-4'>

              <ContactDiv id="fullName" type='text' placeholder='Enter Your FullName' label='Full Name' />

              <ContactDiv id="phone" type='number' placeholder='Enter Your Mobile Number' label='Phone Number' />

              <ContactDiv id="email" type='email' placeholder='Enter Your Email Id' label='Email address' />

              <div class="mb-3">
                <label for="exampleInputMessage" class="form-label">Message</label>
                <textarea
                  class="form-control"
                  id="exampleInputMessage"
                  name={msg}
                  value={data.msg}
                  onChange={fetchData}
                  row="5"></textarea>

                <div id="emailHelp" class="form-text">We'll never share your Details with anyone else.</div>
              </div>

              <button type="submit" class="btn btn-outline-primary">Submit</button>
            </form>
          </div>
        </div>
      </div>
    </div>

  )
}

export default Contact
